            errorMessage = "You must enter password";
        }
        else if (user.City == null || user.City == "")
        {
            errorMessage = "You must enter city";
        }
        else
        {
            InMemoryUserService.AddUser(newUser);
            NavigationManager.NavigateTo("/Login");
        }
